import React from 'react'
import { withStyles, makeStyles, AppBar, Typography } from '@material-ui/core'

const useStyles = makeStyles({
    container: {
        width: "100%",
        height: "150px",
        position: "relative",
        bottom: 0,
        display: "flex",
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        padding: 0,
        flexDirection: "row"

    }
});
export default function Footer(props) {
    const classes = useStyles(props);
    return (
        <AppBar className={classes.container}>
                <div style={{
                    flex: 1,
                    width: 100,
                    height: "inherit",
                    minWidth: '50%',
                    paddingHorizontal: 20,
                }} >
                    <Typography>
                        This is an example Text
                    </Typography>
                </div>
                <div style={{
                    flex: 1,
                    width: 100,
                    height: "inherit",
                    minWidth: '50%',
                    paddingHorizontal: 20,
                }} >
                    <Typography>
                        Another example text
                    </Typography>
                </div>
        </AppBar>
    )
}
